"""
Given an array nums sorted in ascending order, return true if and only if you can split it into 1 or more subsequences such that each subsequence consists of consecutive integers and has length at least 3.

Example 1:

Input: [1,2,3,3,4,5]
Output: True
Explanation:
You can split them into two consecutive subsequences :
1, 2, 3
3, 4, 5

Example 2:

Input: [1,2,3,3,4,4,5,5]
Output: True
Explanation:
You can split them into two consecutive subsequences :
1, 2, 3, 4, 5
3, 4, 5

Example 3:

Input: [1,2,3,4,4,5]
Output: False

Constraints:

	1 <= nums.length <= 10000
"""
from pprint import pprint
from collections import Counter
from collections import defaultdict
import sys
from typing import List
import pytest


class Solution:
    def isPossible(self, nums: List[int]) -> bool:
        cnt = defaultdict(int)
        for n in nums:
            cnt[n] += 1
        ends = defaultdict(int)
        keys = list(cnt.keys())
        for n in keys:
            if cnt[n] == 0:
                continue
            removes = min(ends[n-1], cnt[n])
            ends[n-1] -= removes
            ends[n] += removes
            cnt[n] -= removes
            if cnt[n+1] >= cnt[n] and cnt[n+2] >= cnt[n]:
                cnt[n+1] -= cnt[n]
                cnt[n+2] -= cnt[n]
                ends[n+2] += cnt[n]
            else:
                return False
        return True


    def _isPossible(self, nums: List[int]) -> bool:
        finished = defaultdict(int)
        current = defaultdict(lambda: defaultdict(int))
        for n in nums:
            if n-1 in current:
                length, count = next(iter(current[n-1].items()))
                if length+1 < 3:
                    current[n][length+1] += 1
                else:
                    finished[n] += 1

                current[n-1][length] -= 1
                if current[n-1][length] == 0:
                    current[n-1].pop(length)
                if len(current[n-1]) == 0:
                    current.pop(n-1)
            else:
                current[n][1] += 1
        for n, length_count in current.items():
            for length, count in length_count.items():
                finished[n-length] -= count
                if finished[n-length] < 0:
                    return False
                elif finished[n-length] == 0:
                    finished.pop(n-length)
                finished[n] += count
        return True


